        public void AgregarVehiculo()
        {
            using (db_a72daa_proyecContext context = new db_a72daa_proyecContext())
            {
                validar = context.Vehiculos.Any(ee => ee.Matricula == matricula);
                if (validar)
                {
                    mensaje = 2;
                }

                else
                {
