                tipo = datos.Tipo;
                capacidad = datos.Capacidad;
                pasajeros = datos.Pasajeros;
                matricula = datos.Matricula;
                num_seguro = datos.NumSeguro;
                latitud = datos.Latitud;
                longitud = datos.Longitud;
